INSERT INTO `csosn_simples_nacional` (`idCsosn`, `descricao`, `codigo`, `obs`) VALUES
(1, '101 - Tributada pelo Simples Nacional com permissão de crédito', 101, '- Classificam-se neste código as operações que permitem a indicação da alíquota do ICMS devido no Simples Nacional e o valor do crédito correspondente.'),
(2, '102 - Tributada pelo Simples Nacional sem permissão de crédito', 102, '- Classificam-se neste código as operações que não permitem a indicação da alíquota do ICMS devido pelo Simples Nacional e do valor do crédito, e não estejam abrangidas nas hipóteses dos códigos 103, 203, 300, 400, 500 e 900.'),
(3, '103 - Isenção do ICMS no Simples Nacional para faixa de receita bruta', 103, '- Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional contemplados com isenção concedida para faixa de receita bruta nos termos da Lei Complementar nº 123, de 2006.'),
(4, '\r\n\r\n201 - Tributada pelo Simples Nacional com permissão de crédito e com cobrança do ICMS por substituição tributária', 127, '- Classificam-se neste código as operações que permitem a indicação da alíquota do ICMS devido pelo Simples Nacional e do valor do crédito, e com cobrança do ICMS por substituição tributária.'),
(5, '202 - Tributada pelo Simples Nacional sem permissão de crédito e com cobrança do ICMS por substituição tributária', 127, '- Classificam-se neste código as operações que não permitem a indicação da alíquota do ICMS devido pelo Simples Nacional e do valor do crédito, e não estejam abrangidas nas hipóteses dos códigos 103, 203, 300, 400, 500 e 900, e com cobrança do ICMS por substituição tributária.'),
(6, '203 - Isenção do ICMS no Simples Nacional para faixa de receita bruta e com cobrança do ICMS por substituição tributária', 127, '- Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional contemplados com isenção para faixa de receita bruta nos termos da Lei Complementar nº 123, de 2006, e com cobrança do ICMS por substituição tributária.'),
(7, '300 – Imune', 127, '- Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional contempladas com imunidade do ICMS.'),
(8, '400 - Não tributada pelo Simples Nacional', 127, '- Classificam-se neste código as operações praticadas por optantes pelo Simples Nacional não sujeitas à tributação pelo ICMS dentro do Simples Nacional.'),
(9, '500 - ICMS cobrado anteriormente por substituição tributária (substituído) ou por antecipação', 127, '- Classificam-se neste código as operações sujeitas exclusivamente ao regime de substituição tributária na condição de substituído tributário ou no caso de antecipações.'),
(10, '900 – Outros', 127, '- Classificam-se neste código as demais operações que não se enquadrem nos códigos 101, 102, 103, 201, 202, 203, 300, 400 e 500.');
