INSERT INTO `parametro_geral` (`idparametro`, `txt_contrato`, `txt_bemvindo`, `txt_encerramento`, `txt_indIEDest`) VALUES
(1, 'CONTRATO DE USO DE SOFTWARE -  IMPORTANTE: \r\nAo aceitar eletronicamente estes termos, mediante ao clique no botão “Aderir” e o habilitar de \"Concordo com os termos do contrato\"  desta página de registro, o cliente estará declarando anuência às condições deste contrato e de qualquer de suas alterações futuras.\r\nIDENTIFICAÇÃO DAS PARTES - CONTRATADA: Marcos Daniel Bras, com sede em São Paulo, na Rua Antonio Pereira Simões, nº 611, bairro Jd. Paranaguá, Cep 03808-050, no Estado SP, inscrita no CPF sob o nº 131.777.658-55,Analista Programador. Na outra parte, doravante denominada de CLIENTE, o adquirente da presente LICENÇA DE USO DE SOFTWARE que deverá se qualificar posteriori à inscrição dos dados do emitemente por sua vez já estando dentro do sistema através de seu login e senha secreta cadastrada no momento da adesão. \r\nEste CONTRATO representa a prova de\r\nLICENÇA DE USO e deve ser tratado como propriedade valiosa. O software objeto desta LICENÇA, também pode pode ser tratado pela denominação de programa de computador, programa, software, sistema ou site. Para melhor esclarecimento a contrada afirma que o software deste objeto é de código aberto.Adesão ao Contrato:A aceitação deste CONTRATO se concretiza na ocasião da utilização, mesmo que parcial ou a título de teste do SOFTWARE, ou na aquisição desta LICENÇA	DE USO DE SOFTWARE, feita eletronicamente através da internet ou\r\natravés  de pedido direto a CONTRATADA ou a um de suas representantes.	NORMAS	\r\nE CONDIÇÕES GERAIS:\r\n1.1. CONDIÇÕES E PLANO ESCOLHIDO: O SOFTWARE é disponibilizado pela\r\nCONTRATADA para utilização do CLIENTE\r\nvia internet, tablet, celular. Para que o CLIENTE possa utilizar o SOFTWARE se faz necessário que o aparelho do mesmo\r\nesteja devidamente conecto na internet.Em qualquer dos planos escolhidos a base de dados e plataforma será sempre compartilhada com outros clientes, a CONTRATADA também se isenta de guardar de forma definitiva os documento, fotos, textos, anexos, entre outros armazedos na plataforma, devendo o cliente manter cópia destes mesmos documentos em outro local de sua escolha para posterior recuperação. \r\n1.2.DOS PAGAMENTOS: O CLIENTE pagará a CONTRATADA manutenção mensal estipulada de acordo com valores do planos estabelecidos no site da CONTRATADA. Os valores dos serviços e recursos oferecidos pela  CONTRATADA podem ser corrigidos anualmente pelo IGPM. A   CONTRATADA poderá realizar o bloqueio, suspensão e até o cancelamento dos\r\nserviços, com possibilidade de perda total de conteúdo, na hipótese do não\r\npagamento pelos serviços prestados após 5 dias do vencimento. Caso o\r\nCLIENTE efetue pagamento através de depósito direto em conta, o mesmo deverá informar por escrito Todos\r\nos dados relativos ao depósito realizado e a CONTRATADA poderá incluir	em vencimento futuro a diferença a multa ou juros, caso o mesmo seja devido.\r\n1.3. PERDA DA SENHA DE ACESSO: caso o CLIENTE não tenha mais acesso ao sistema por motivo de perda da senha ou algo semelhante o mesmo deve solicitar outra senha via email originada da mesma conta de email cadastrada no sistema, caso não tenho mais acesso ao email deverá enviar cópia de RG e CPF, Cópia do contrato social caso seja pessoa jurídica e informar no corpo da mensagem email antigo e novo email para que seja providenciada outro acesso também  os dados registradados no cadastro do emitente deverá coencidir com as cópiaa dos documentos. \r\n	\r\nEm hipótese alguma a CONTRARADA será responsável por lucros cessantes,\r\nindenizações de qualquer espécie, danos comerciais, especiais, acidentais,\r\nconsequências ou outros diretos ou indiretos.	\r\n  ', NULL, NULL, 'Nota 1: No caso de NFC-e informar 9 e não informar IE do destinatário;\r\n\r\nNota 2: No caso de operação com o Exterior informar 9 e não informar a IE do destinatário;\r\n\r\nNota 3: No caso de Contribuinte Isento de Inscrição 2, não informar a IE do destinatário.');
